import logo from './logo.svg';
import React from "react";
import './App.css';
import {
  Dropdown,
  DropdownButton,
  Container,
  Row,
  Col,
  Modal,
  Button
} from "react-bootstrap";

class Car extends React.Component {
  constructor(props) {
    super(props);
    this.state = {}
  }


  goTo () {
    console.log("Go to")
    this.props.history.push('/');


}



render(){
  return (
    <div className="App">
      Title: {this.props.location.state.title}
      Photo: <img src={this.props.location.state.photo} alt="Test"/> 
      Description: {this.props.location.state.description}
      Short Short_Description: {this.props.location.state.short_description}
      <Button onClick={this.goTo}></Button>
    </div>
  );}
}

export default Car;
